import React from 'react';

export default function Contact() {
  return (
    <div className="container p-5">
      <h2>Contact Us</h2>
      <p>Email: support@cleanswift.com</p>
      <p>Phone: +1-800-555-0199</p>
      <p>Address: 123 Clean Street, Sparkle City, SC</p>
    </div>
  );
}
